void AnnotationUtils::SetFontSize(FontSize fs)
{
    AnnotationUtils::m_fontSize = fs;
}

Mask AnnotationUtils::DownSampling(const Mask& mask, int ratio)
{
    int w = mask.width / ratio;
    int h = mask.height / ratio;

    unsigned char* pImg = mask.pImg.get();
    std::shared_ptr<unsigned char> pData(new unsigned char[w*h]);
    for (int y=0; y<h; y++){
        for (int x=0; x<w; x++){
            int sum = 0;
            for (int ys=y*ratio; ys<(y+1)*ratio; ys++){
                for (int xs=x*ratio; xs<(x+1)*ratio; xs++){
                    sum += pImg[ys*mask.width + xs];
                }
            }
            pData.get()[y*w+x] = (unsigned char)(sum/(ratio*ratio));
        }
    }
    return Mask(w, h, pData);
}

Mask& AnnotationUtils::GetCharMask(std::string c)
{
    return AnnotationUtils::m_char2Mask[c][AnnotationUtils::m_fontSize];
}

std::shared_ptr<unsigned char> AnnotationUtils::GetCharImage(std::string b64, int& nWidth, int& nHeight)
{
    std::string deb64 = Base64::Decode(b64.data(), b64.length());
    nHeight = 76;
    nWidth = deb64.length()/nHeight;

    std::shared_ptr<unsigned char> pData(new unsigned char[nWidth*nHeight]);
    memcpy(pData.get(), deb64.data(), nWidth*nHeight*sizeof(unsigned char));
    return pData;
}

bool AnnotationUtils::Textout2Image(std::string str, int x, int y, AnnotationFormat annoFormat, RGBA clr, unsigned char* pImg, int nWidth, int nHeight)
{
    if(nullptr==pImg || nWidth<10 || nHeight<10){
        return false;
    }

    int xStart = x;
    int yStart = y;
    if (annoFormat == AnnotationFormatNotDefined){
        return false;
    }
    else if (annoFormat == AnnotationFormatCenter
        || annoFormat == AnnotationFormatRight
    ){
        int w =-1, h = -1;
        AnnotationUtils::GetSize(str, w, h);
        if (annoFormat == AnnotationFormatCenter){
            xStart -= w/2;
        }
        else if (annoFormat == AnnotationFormatRight){
            xStart -= w;
        }
    }

    for (int i=0; i<str.length(); i++){
        Mask& mask = AnnotationUtils::GetCharMask(str.substr(i, 1));
        int w = mask.width, h=mask.height;
        unsigned char* pMask = mask.pImg.get();
        
        for (int yy=yStart; yy<yStart+h; yy++){
            for (int xx=xStart; xx<xStart+w; xx++){
                if (xx<0 || xx>=nWidth || yy<0 || yy>=nHeight){
                    continue;
                }
                if (pMask[(yy-yStart)*w+xx-xStart] > 0){
                    pImg[(yy*nWidth+xx)*3] = pMask[(yy-yStart)*w+xx-xStart] * clr.red;
                    pImg[(yy*nWidth+xx)*3+1] = pMask[(yy-yStart)*w+xx-xStart] * clr.green;
                    pImg[(yy*nWidth+xx)*3+2] = pMask[(yy-yStart)*w+xx-xStart] * clr.blue;
                }
            }
        }

        xStart += w;
    }
    return true;
}

void AnnotationUtils::GetSize(std::string str, int& nWidth, int& nHeight)
{
    nWidth = 0;
    nHeight = 0;
    for (int i=0; i<str.length(); i++){
        Mask& mask = AnnotationUtils::GetCharMask(str.substr(i, 1));
        nWidth += mask.width;
        nHeight = mask.height;
    }
}